import { useState, useCallback } from "react";
import Mytrip from "./Mytrip";
import PortalPopup from "./PortalPopup";
import "./Navbar.css";
import { useNavigate } from "react-router-dom";

const Navbar = () => {
    const [isMytripOpen, setMytripOpen] = useState(false);
    const navigate = useNavigate();
    const openMytrip = useCallback(() => {
        setMytripOpen(true);
    }, []);

    const closeMytrip = useCallback(() => {
        setMytripOpen(false);
    }, []);

    const openSidebar = () => {
        // Implement the logic to open the sidebar here
    };

    return (
        <>
            <div className="navbar">
                <div className="nav-buttons">
                    <button onClick={() => navigate("/dashboard/ashol-dashboard")} className="navbar-button">Trips</button>
                    <button className="navbar-button">Community</button>
                    <button className="navbar-button" onClick={openSidebar}>My Plans</button>
                </div>
                <div className="nav-image" onClick={openSidebar}>
                    <img src="/navbar_pic.png" alt="User" />
                </div>
            </div>
            {isMytripOpen && (
                <PortalPopup
                    overlayColor="rgba(113, 113, 113, 0.3)"
                    placement="Centered"
                    onOutsideClick={closeMytrip}
                >
                    <Mytrip onClose={closeMytrip} />
                </PortalPopup>
            )}

            {/* Sidebar content */}
            <div className="sidebar">
                <div className="sidebar-content">
                    <div className="user-info">
                        <img src="/navbar_pic.png" alt="User" />
                        <h2>User Name</h2>
                    </div>
                    <div className="notification">
                        <p>Notifications</p>
                    </div>
                    <div className="discount">
                        <p>Discounts</p>
                    </div>
                    <div className="badges">
                        <p>Badges</p>
                    </div>
                    <div className="settings">
                        <p>Settings</p>
                    </div>
                    <div className="logout">
                        <p>Logout</p>
                    </div>
                </div>
            </div>
        </>
    );
};

export default Navbar;
